import React, {Component} from 'react';
import {Cards, Chart, Country} from './components';
import style from './App.module.css';
export class App extends Component {
	render() {
		return (
			<div className={style.container}>
				<Cards />
				<Chart />
				<Country />
			</div>
		);
	}
}

export default App;
